import React from "react";

const Innerlayout = ({ children, heading, subheading, ...props }) => {
  return (
    <div className="innerlayout">
      <div className="innerlayout-main">
        <h1 className="font-bold text-[32px]">{heading}</h1>
        {children}
      </div>
    </div>
  );
};

export default Innerlayout;
